import PayElementGlAccount from './PayElementGlAccount';

export const PayElementGlAccountConfig = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes  : [
        {
            path     : '/payelementglaccount',
            component: PayElementGlAccount
        }
    ]
};
